import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Home from './pages/home';
import Ambient from './pages/ambient';
import Focus from './pages/focus';
import Settings from './components/Settings';

import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const AppWithRouter = () => {
  const [selectedBackground, setSelectedBackground] = React.useState('default');

  const handleBackgroundChange = (background) => {
    setSelectedBackground(background);
  };

  const router = createBrowserRouter([
    {
      path: "/",
      element: <App />,
    },
    {
      path: "home",
      element: <Home selectedBackground={selectedBackground} />,
    },
    {
      path: "ambient",
      element: <Ambient />,
    },
    {
      path: "focus",
      element: <Focus />,
    },
    {
      path: "settings",
      element: (
        <Settings
          showSettings={true} // Example value, adjust as needed
          onClose={() => {}} // Example value, adjust as needed
          selectedBackground={selectedBackground}
          handleBackgroundChange={handleBackgroundChange}
        />
      ),
    },
  ]);

  return (
    <RouterProvider router={router} />
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <AppWithRouter />
  </React.StrictMode>
);

reportWebVitals();
